import "./styles.css";
import "bootstrap/dist/css/bootstrap.css";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Reset from "./pages/Reset";
import Register from "./pages/Register"

import React, { useContext } from 'react';
import {Context} from './context/AuthContext'

import { BrowserRouter , Routes, Route, redirect, Link , useNavigate} from "react-router-dom";

import Search from "./pages/Search";
import LandPage from "./components/LandPage";

import { AuthProvider } from './context/AuthContext';


function CustomRoute({ isPrivate, ...rest }){

  const { authenticated } = useContext(Context);

  if(isPrivate && !authenticated){
    return <redirect to="/login" />
  }

  return <Route {...rest} />
}




export default function App() {

  return (
    <AuthProvider>
    <div className="App">   
      
        <BrowserRouter>
   
            <CustomRoute path = "/" element = {<LandPage/>}/>  

            <CustomRoute path = "/login" element = {<Login/>}/>     

            <CustomRoute exact path = "/home" element = {<Home/>}/>
 
            <CustomRoute path = "/register" element = {<Register/>}/>  

            <CustomRoute path = "/search" element = {<Search/>}/>
       
            <CustomRoute path = "/reset" element = {<Reset/>}/>

            <CustomRoute path="/home/:id" element= {<Home/>}/>

          <br/>
          <ul>
            <li>
              <Link to="/home">Home</Link>
              <Link to="/login">Login</Link>
              <Link to="/register">Cadastro</Link>
              <Link to="/reset">Redefinir</Link>
            </li>
          </ul>
        </BrowserRouter>
    </div>
    </AuthProvider>
  );
}
